from typing import List

class Solution1:
    def findRightInterval(self, intervals: List[List[int]]) -> List[int]:
        result = []
        for i in range(len(intervals)):
            index, val = -1, float('inf')
            for j in range(len(intervals)):
                if i == j: continue
                if intervals[i][1] <= intervals[j][0] and val > intervals[j][0]:
                    index, val = j, intervals[j][0]
            result.append(index)
        return result

from heapq import heapify, heappop
class Solution:
    def findRightInterval(self, intervals: List[List[int]]) -> List[int]:
        result = [-1] * len(intervals)
        right_heap, left_heap = [], []
        for i, (left, right) in enumerate(intervals):
            right_heap.append((right, i)); left_heap.append(((left), i))
        heapify(right_heap); heapify(left_heap)
        left_val = float('-inf')
        while len(right_heap) > 0:
            right_val, r_i = heappop(right_heap)
            while len(left_heap) > 0 and right_val > left_val:
                left_val, l_i = heappop(left_heap)
                left_val = left_val
            if right_val <= left_val:
                result[r_i] = l_i
        return result

        





